import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
import Card from "../UI/Card";
import ExpensesFilter from "./ExpensesFilter";
import { useState } from "react";

function Expenses(props) {
  const [startYear, setStartYear] = useState(`2019`);

  const changeYearFilter = (year) => {
    console.log(`Coming from expenses`);
    setStartYear(year);
    console.log(year);
  };
  return (
    <div>
      <Card className="expenses">
        <ExpensesFilter selected={startYear} onChangeYear={changeYearFilter} />

        {props.itmes.map((expense) => {
          <ExpenseItem
            title={expense.title}
            date={expense.date}
            amount={expense.amount}
          />;
        })}
        <ExpenseItem
          title={props.itmes[0].title}
          date={props.itmes[0].date}
          amount={props.itmes[0].amount}
        ></ExpenseItem>
        <ExpenseItem
          title={props.itmes[1].title}
          date={props.itmes[1].date}
          amount={props.itmes[1].amount}
        ></ExpenseItem>
        <ExpenseItem
          title={props.itmes[2].title}
          date={props.itmes[2].date}
          amount={props.itmes[2].amount}
        ></ExpenseItem>
        <ExpenseItem
          title={props.itmes[3].title}
          date={props.itmes[3].date}
          amount={props.itmes[3].amount}
        ></ExpenseItem>
      </Card>
    </div>
  );
}
export default Expenses;
